import axios from "axios";
import { useState } from "react";
import { useNavigate, useParams } from "react-router-dom";
import Swal from "sweetalert2";

const URI = 'http://localhost:8000/createDeportivo/';

const CompCreateDeportivo = () => {
    const navigate = useNavigate();
    const {ID_Direccion} = useParams() 
    const [Numero_Registro, setNumero_Registro] = useState('')
    const [Nombre, setNombre] = useState('')
    const [Acepta_Mascotas, setAceptaMascotas] = useState('');
    const [Tienda, setTienda] = useState('');
    const [Vestidores, setVestidores] = useState('');
    const [Regaderas, setRegaderas] = useState('');
    const [Médico, setMédico] = useState('');
    const [formErrors, setFormErrors] = useState({
        nombre: '',
        Numero_Registro: ''
    });

    const store = async (e) => {
        e.preventDefault();
        
        try {
            const isValid = validateForm();
            if (isValid) {
            const response = await axios.post(URI, { 
                Nombre: Nombre, 
                Numero_Registro: Numero_Registro,
                ID_Direccion: ID_Direccion,
                Acepta_Mascotas: Acepta_Mascotas,
                Tienda: Tienda,
                Vestidores: Vestidores,
                Regaderas: Regaderas,
                Médico: Médico
            });

            if (response.status === 201) {
                const ID_Deportivo = response.data.ID_Deportivo;
                navigate(`/createHorario/${ID_Deportivo}`);
            } else {
                showErrorAlert("Hubo un error al crear el deportivo. Inténtalo de nuevo.");
            }
        }
        } catch (error) {
            console.error("Error:", error);
            showErrorAlert("Hubo un error al crear el deportivo. Inténtalo de nuevo.");
        }
    };

    const showErrorAlert = (message) => {
        Swal.fire({
            icon: 'error',
            title: 'Error',
            text: message,
            confirmButtonText: 'OK'
        });
    };

    const validateForm = () => {
        let valid = true;
        const errors = {
            nombre: '',
            Numero_Registro: ''
        };

        if (!Nombre) {
            errors.nombre = "El nombre es requerido";
            valid = false;
        }

        if (!Numero_Registro) {
            errors.Numero_Registro = "El numero de registro es requerido";
            valid = false;
        }

        setFormErrors(errors);
        return valid;
    };


    return (
        <div className="formulario">
            <h1>Ingresar nuevo deportivo</h1>
            <h1>Información General</h1>
            <form onSubmit={store}>
                <div className="form-group">
                    <label>Nombre</label>
                    <input type="text" value={Nombre} onChange={(e) => setNombre(e.target.value)} className={`form-control ${formErrors.nombre && 'is-invalid'}`} />
                    {formErrors.nombre && <div className="invalid-feedback">{formErrors.nombre}</div>}
                </div>
                <div className="form-group">
                    <label>Número de Registro</label>
                    <input type="text" value={Numero_Registro} onChange={(e) => setNumero_Registro(e.target.value)} className={`form-control ${formErrors.Numero_Registro && 'is-invalid'}`} />
                    {formErrors.Numero_Registro && <div className="invalid-feedback">{formErrors.Numero_Registro}</div>}
                </div>
                <div className="form-group">
                    <label>¿Acepta Mascotas?</label>
                    <input type="checkbox" checked={Acepta_Mascotas} onChange={(e) => setAceptaMascotas(e.target.checked)} />
                    <label>¿Tiene Tienda?</label>
                    <input type="checkbox" checked={Tienda} onChange={(e) => setTienda(e.target.checked)} />
                    <label>¿Tiene Vestidores?</label>
                    <input type="checkbox" checked={Vestidores} onChange={(e) => setVestidores(e.target.checked)} />
                    <label>¿Tiene Regaderas?</label>
                    <input type="checkbox" checked={Regaderas} onChange={(e) => setRegaderas(e.target.checked)} />
                    <label>¿Hay Médico?</label>
                    <input type="checkbox" checked={Médico} onChange={(e) => setMédico(e.target.checked)} />
                                
                </div>
                <button type="submit" className="btn btn-primary">Crear Deportivo</button>
            </form>
        </div>
    );
}

export default CompCreateDeportivo;
